    public static String addNewLine(String str) {
        StringBuilder sb = new StringBuilder(str);
        int i = 76;
        while (i < sb.length()) {
            sb.insert(i, "\\n");
            i += 78; // 因为我们插入了一个额外的字符，所以要跳过它
        }

        return sb.toString()+"\\n";
    }
