    @RequiresApi(api = Build.VERSION_CODES.O)
    public static String order_create(String params_dict) {
        try {

            String dumped_str = params_dict.replace(" ", "");
            ByteArrayOutputStream byteStream = new ByteArrayOutputStream();
            GZIPOutputStream gzipStream = new GZIPOutputStream(byteStream, true);


            gzipStream.write(dumped_str.getBytes("UTF-8"));

            gzipStream.close();
            byte[] compressedBytes = byteStream.toByteArray();
            String encoded_str = Base64.getMimeEncoder().encodeToString(compressedBytes);
            return encoded_str;
        }catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    }

